# San Luis Obispo ================================================================
Beach.create( name:"William Randolph Hearst Memorial State Beach", phone:"805-927-2020", url:"http://www.parks.ca.gov/?page_id=589", description: "The beach is located near the historic town of San Simeon along Highway One and gives visitors the opportunity to hike, swim, fish and beachcomb. A popular beach spot, this protected cove also offers visitors pier fishing and deep-sea fishing from chartered boats. Ocean kayaking is also popular. Picnic tables, barbecue grills and restrooms are available. This day use area offers 24 picnic sites, 150 parking spaces, restrooms, water faucets, barbecue grill stands and easy beach access. Recreational activities include picnicking, swimming, fishing, boating, kayaking and sunbathing. There is a kayak and boogie board concession in operation with equipment for rent.", address_street:"750 Hearst Castle Road", address_city:"San Simeon", address_state:"CA", address_zip:"93452", county:"San Luis Obispo", latitude:"35.643603", longitude:"-121.187861", parking: TRUE, parking_price:"na", lifeguard: FALSE, restroom: FALSE, surfing: FALSE, firepit: FALSE, volleyball: FALSE, dog: FALSE, fishing:TRUE, hours:"Dawn to Dusk")
Beach.create( name:"Cayucos State Beach", phone:"(805) 781-5930", url:"http://www.parks.ca.gov/?page_id=596", description: "It is known for its fishing pier, beautiful beach and historical buildings. Many of the buildings left over from the prospering old town still stand as a variety of shops such as restaurants, antique stores, and speciality items. The sandy beach offers mild weather, watersports such as surfing and swimming, and tidepooling. Lifeguards are on duty during peak summer months.", address_street:"10 Cayucos Dr", address_city:"Cayucos", address_state:"CA", address_zip:"93430", county:"San Luis Obispo", latitude:"35.449478", longitude:"-120.906608", parking: TRUE, parking_price:"n/a", lifeguard: TRUE, restroom: TRUE, surfing: TRUE, firepit: FALSE, volleyball: FALSE, dog: FALSE, fishing: TRUE, hours:"n/a")
