Beach.create( name:"Butterfly Beach", phone:"n/a", url:"https://www.santabarbara.com/activities/beaches/butterfly/", description: "Across from the Four Seasons Biltmore, this beach is deceptive in its simplicity. Since it is a Montecito Beach, and Montecito and the Biltmore have more than their share of celebrities, you have a good chance of seeing somebody famous here.", address_street:"1176 Channel Dr", address_city:"Montecito", address_state:"CA", address_zip:"93108", county:"Santa Barbara", latitude:"34.41718", longitude:"-119.645025", parking:FALSE, parking_price:"na", lifeguard:FALSE, restroom:FALSE, surfing:FALSE, firepit:FALSE, volleyball:FALSE, dog:FALSE, fishing:FALSE, hours:"na")
Beach.create( name:"Point Sal State Beach", phone:"(805) 733-3713", url:"http://www.parks.ca.gov/?page_id=605", description: "Point Sal State Beach (SB) is located in the northwestern part of Santa Barbara County, near the city of Guadalupe. The park consists of approximately 80 acres and includes just over 1 1/2 miles of ocean frontage. Lands above the beach and rocky shoreline have extremely steep slopes, and numerous landslides are evident. Prime examples of coastal sage and chaparral communities occur on these slopes. Giant coreopsis is abundant in the area and dominates wildflower displays in the spring.", address_street:"Point Sal Beach State Park", address_city:"Guadalupe", address_state:"CA", address_zip:"93434", county:"Santa Barbara", latitude:"34.8974378", longitude:"-120.6435795", parking: FALSE, parking_price:"n/a", lifeguard: FALSE, restroom: FALSE, surfing: FALSE, firepit: FALSE, volleyball: FALSE, dog: FALSE, fishing: FALSE, hours:"n/a")
