Beach.create( name:"Silver Strand Beach", phone:"(619) 435-5184", url:"http://www.parks.ca.gov/?page_id=654", description: "Silver Strand State Beach features extensive beaches on both the Pacific Ocean and San Diego Bay. Combined with the area’s mild climate, the beaches make Silver Strand one of the area’s finest recreation destinations. Camping, swimming, surfing, boating, water-skiing, volleyball, and picnicking are popular activities. Anglers can fish for perch, corbina, grunion and yellow-fin croaker.", address_street:"5000 Highway 75", address_city:"Coronado", address_state:"CA", address_zip:"92118", county:"Ventura", latitude:"32.6349631", longitude:"-117.1423041", parking:TRUE, parking_price:"na", lifeguard:TRUE, restroom:TRUE, surfing:TRUE, firepit:FALSE, volleyball:FALSE, dog:FALSE, fishing:FALSE, hours:"na")
