# Los Angeles ================================================================
Beach.create( name:"Santa Monica State Beach", phone:"310-458-8300", url:"http://www.smgov.net/portals/beach/", description: "Santa Monica State Beach is an iconic destination that draws visitors from around the globe. It is 3 miles long, covering 245 acres of sand along Santa Monica Bay. Residents and visitors enjoy broad stretches of sandy beach, rolling waves, meandering bike and walking paths, and inspiring views of the Santa Monica Mountains year-round. Santa Monica State Beach is managed by the City of Santa Monica in cooperation wtih California State Parks.", address_street:"200 Santa Monica Pier", address_city:"Santa Monica", address_state:"CA", address_zip:"90401", county:"Los Angeles", latitude:"34.0150456", longitude:"-118.5038705", parking:TRUE, parking_price:"na", lifeguard:TRUE, restroom:TRUE, surfing:TRUE, firepit:FALSE, volleyball:TRUE, dog:FALSE, fishing:TRUE, hours:"24 hours")
Beach.create( name:"Venice City Beach", phone:"No phone number", url:"http://www.discoverlosangeles.com/blog/things-to-do-venice-california", description: "Venice offers a unique and vibrant mix of activities and attractions. Originally called “Venice of America,” Venice was founded in 1905 by developer Abbot Kinney as a beachfront resort town. Kinney’s initial vision of creating a cultural mecca was set aside to accommodate the public, and Venice became the “Coney Island of the Pacific,” complete with an amusement pier and a miniature steam railroad. Kinney also created a system of canals and imported gondolas and gondoliers from Venice, Italy.", address_street:"Venice Fishing Pier", address_city:"Los Angeles", address_state:"CA", address_zip:"", county:"", latitude:"33.978265", longitude:"-118.466654", parking: TRUE, parking_price:"n/a", lifeguard: TRUE, restroom: TRUE, surfing: TRUE, firepit: FALSE, volleyball: TRUE, dog: FALSE, fishing: TRUE, hours:"")
Beach.create( name:"Manhattan Beach", phone:"No phone number", url:"http://beaches.lacounty.gov/wps/portal/dbh/home/detail/?current=true&urile=wcm:path:/dbh+content/dbh+site/home/home+detail/manhattan+1", description: "Great spot to chill out and catch some rays.", address_street:"101-115 Manhattan Beach Blvd", address_city:"Manhattan Beach", address_state:"CA", address_zip:"90266", county:"Los Angeles", latitude:"33.884425", longitude:"-118.411652", parking: TRUE, parking_price:"n/a", lifeguard: TRUE, restroom: TRUE, surfing: TRUE, firepit: FALSE, volleyball: TRUE, dog: FALSE, fishing: TRUE, hours:"n/a")
