Beach.create( name:"Seal Beach", phone:"(562) 431-2527", url:"http://www.sealbeachca.gov/", description: "The second longest wooden pier in California (the longest is in Oceanside) is located in Seal Beach and is used for fishing and sightseeing. The pier has periodically suffered severe damage due to storms and other mishaps, requiring extensive reconstruction.", address_street:"888 Ocean Avenue", address_city:"Seal Beach", address_state:"CA", address_zip:"90740", county:"Orange County", latitude:"33.7392678", longitude:"-118.1045985", parking:TRUE, parking_price:"na", lifeguard:TRUE, restroom:FALSE, surfing:FALSE, firepit:FALSE, volleyball:FALSE, dog:FALSE, fishing:FALSE, hours:"na")
Beach.create( name:"Huntington Beach", phone:"(714) 536-1454", url:"http://www.parks.ca.gov/?page_id=643", description: "Huntington State Beach is located in the City of Huntington Beach in Orange County. The 121 acre state beach is a popular destination for water enthusiasts of all ages and draws hundreds of thousands of visitors year round.  Huntington in a great place to surf, swim, sunbathe, fish or just watch the sun set. Average summer temperatures range in the high 70s, while winter brings slightly cooler mid-60-degree weather.", address_street:"21601 Pacific Coast Hwy", address_city:"Huntington Beach", address_state:"CA", address_zip:"92646", county:"Orange County", latitude:"33.648079", longitude:"-117.988036", parking: TRUE, parking_price:"15", lifeguard: TRUE, restroom: TRUE, surfing: TRUE, firepit: TRUE, volleyball: TRUE, dog: FALSE, fishing: TRUE, hours:"n/a")
Beach.create( name:"Newport Beach Municipal Beach", phone:"(949) 644-3309", url:"http://www.visitnewportbeach.com/beaches-and-parks/newport-municipal-beach/", description: "Newport Beach offers fine, soft sand with plenty of room to stretch out and enjoy yourself. Surfers, swimmers and sunbathers all bask in the warmth of beautiful Southern California winter and summer days. Pelicans and seagulls also enjoy Southern California’s year round Mediterranean climate.", address_street:"Balboa Blvd. at Oceanfront & 21st St.", address_city:"Newport Beach", address_state:"CA", address_zip:"92661", county:"Orange County", latitude:"33.606042", longitude:"-117.926259", parking: TRUE, parking_price:"n/a", lifeguard: TRUE, restroom: TRUE, surfing: TRUE, firepit: FALSE, volleyball: FALSE, dog: FALSE, fishing: TRUE, hours:"n/a")
